import React from "react";
import "./card.css";

function Card() {
  return (
    <>
      <div className="card">
        <div className="card-image-container">
          <img src="images/website.svg" alt="image" />
        </div>
        <div className="card-text-container">
          <div className="card-heading"></div>
          <div className="card-description"></div>
        </div>
      </div>
    </>
  );
}

export default Card;
